import React from 'react';

function events() {
    function handleClick(e) {
      e.preventDefault();
      console.log('Clicked');
    }
  
    return (
      <form onSubmit={handleClick}>
        <button type="submit">Submit</button>
      </form>
    );
  }

  export default events;
